        return new Source("{% extends 'template/frontend.html.twig' %}

{% block title %}
    Login
{% endblock %}

{% block body %}
    <h1>Login </h1> 
    
    {% if error %}
        <div class=\"alert alert-danger alert-dismissible fade show\">{{ error.messageKey|trans(error.messageData, 'security') }}
        <button type=\"button\" class=\"btn-close\" data-bs-dismiss=\"alert\" aria-label=\"Close\"></button>
        </div>
    {% endif %}

    <form action=\"{{ path('acceso_login') }}\" method=\"post\">
    <div class=\"form-group\">
       <label for=\"username\">Email:</label>
        <input type=\"text\" id=\"username\" name=\"_username\" value=\"{{ last_username }}\" class=\"form-control\" />
    </div>
       
    <div class=\"form-group\">
       <label for=\"password\">Password:</label>
        <input type=\"password\" class=\"form-control\" id=\"password\" name=\"_password\">
    </div>
       
    <hr />
       
        <input type=\"hidden\" name=\"_target_path\" value=\"/restringido\" />  
        <input type=\"hidden\" name=\"token\" value=\"{{ csrf_token('generico') }}\"/>
        <button type=\"submit\" class=\"btn btn-primary\">Enviar</button>
    </form>

{% endblock %}", "acceso/login_normal.html.twig", "/home/rodrialeh/Documentos/CursoSymfony/curso_1_cli/templates/acceso/login_normal.html.twig");
